import React from "react";
import { useParams, NavLink, useHistory } from "react-router-dom";
import style from "../StudentDashboard.module.css";

function Exam() {
    let { category } = useParams();
    const history = useHistory();

    const handleGoToExam = async (examId) => {
        try {
            // Start proctoring
            const proctoringResponse = await fetch("http://127.0.0.1:5000/start_proctoring", {
                method: "POST",
                headers: {
                    "Content-Type": "application/json"
                }
            });
            if (!proctoringResponse.ok) {
                throw new Error("Failed to start proctoring");
            }

            // If proctoring started successfully, navigate to the exam page
            history.push(`/StudentDashboard/Exam/${category}/${examId}`);
        } catch (error) {
            console.error("Error:", error);
            // Handle error
        }
    };

    const allExam = [
        {
            id: 1,
            name: "Maths",
            desc: "Mathematics exam description",
            passMarks: 50,
            marks: 100
        },
        {
            id: 2,
            name: "Science",
            desc: "Science exam description",
            passMarks: 60,
            marks: 120
        },
        // Add more static data as needed
    ];

    return (
        <>
            <div id={style.displayBoxHeadingBox}>
                <h1>All {category} Exam</h1>
            </div>
            {
                allExam.map((data, i) => {
                    if (data.name === category)
                        return (
                            <div id={style.displayBoxExamBox} key={i}>
                                <div id={style.div1}><span>{data.name}</span></div>
                                <div id={style.div2}><span>Exam ID: {data.id}</span></div>
                                <div id={style.div2}><span>Exam Description: {data.desc}</span></div>
                                <div id={style.div3}><span>Pass Marks: {data.passMarks}</span></div>
                                <div id={style.div4}><span>Total Marks: {data.marks}</span></div>
                                <div id={style.div5}>
                                    <NavLink exact to={`/StudentDashboard/Exam/${data.name}/${data.id}`}>
                                        <button onClick={() => handleGoToExam(data.id)}>Go to Exam</button>
                                    </NavLink>
                                </div>
                            </div>
                        );
                    return <React.Fragment key={i}></React.Fragment>;
                })
            }
        </>
    );
}

export default Exam;
